(1, 'reset_password', 'Admin | Reset Password', 'Password Reset Link- {site}', '<div style="margin:0;padding:0;width:100%;font-weight:500;font-size:16px;line-height:26px;background:none #fafafa;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\r\n<table align="center" border="0" cellpadding="20" cellspacing="0" style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:100%;margin:0;padding:0;line-height:100%;background:none #fafafa">\r\n	<tbody>\r\n		<tr style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\r\n			<td style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;width:100%">\r\n			<table align="center" border="0" cellpadding="0" cellspacing="0" style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:650px">\r\n				<tbody>\r\n					<tr style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\r\n						<td style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;width:100%">\r\n						<table style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:100%">\r\n							<tbody>\r\n								<tr style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\r\n									<td align="left" height="45" style="width:50%;color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;padding:0 0 15px"><a style="color:#11B5C4;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none" target="_blank"> <img alt="{site}" helvetica="" neue="" src="{site_link}/backend/dist/img/logo.png" style="color: rgb(255, 91, 95); font-family: " /> </a></td>\r\n									<td align="right" style="width:50%;color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;padding:0 0 15px">&nbsp;</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n\r\n						<table align="left" cellpadding="25" style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:100%;background:none #fff;border-radius:2px;border:solid 1px #eee">\r\n							<tbody>\r\n								<tr style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\r\n									<td style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;width:100%;vertical-align:top">\r\n									<h1 style="color:#11B5C4;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;font-weight:300;line-height:1.1;margin:0 0 20px">Hi {name},</h1>\r\n\r\n									<p style="color:#464643;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:16px;line-height:160%;font-weight:400;padding:0 0 32px;padding-bottom:0px"><a style="color:#11B5C4;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none" target="_blank">Your Reset password Link is given below {site}</a>.</p>\r\n									&nbsp;\r\n\r\n									<p style="text-align:center;color:#464643;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:16px;line-height:160%;font-weight:400;padding:0 0 32px;padding-bottom:0px"><a href="{reset_link}" style="background:#4DB8E4;padding:10px;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none;border-radius:5px;font-size: 22px;color: #ffffff;">Click Here</a></p>\r\n									&nbsp;\r\n\r\n									<p style="color:#464643;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:16px;line-height:160%;font-weight:400;padding:0 0 32px;padding-bottom:0px">Cheers,<br />\r\n									Team {site}</p>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n\r\n						<table style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:100%;padding:24px 0">\r\n							<tbody>\r\n								<tr style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\r\n									<td align="center" height="150" style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;width:100%">\r\n									<p style="color:#b1aca0;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:13px;line-height:18px;text-decoration:none;padding-bottom:24px"><a style="color:#8f8776;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none;font-size:13px;line-height:18px" target="_blank"> <img alt="{site}" helvetica="" neue="" src="{site_link}/backend/dist/img/logo.png" style="color: rgb(255, 91, 95); font-family: " /> </a></p>\r\n\r\n									<p style="color:#b1aca0;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:13px;line-height:18px;text-decoration:none;padding-bottom:24px">This email was sent to <a href="mailto:{email}" style="color:#8f8776;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none;font-size:13px;line-height:18px" target="_blank"> {email}</a>.<br />\r\n									If you want to unsubscribe the emails from {site}, please drop a email at <a href="mailto:{help_email}" style="color:#8f8776;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none;font-size:13px;line-height:18px" target="_blank"> {help_email}</a>.<br />\r\n									If you have any questions or concerns, please email us at <a href="mailto:{info_email}" style="color:#8f8776;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none;font-size:13px;line-height:18px" target="_blank"> {info_email}</a>.</p>\r\n\r\n									<p style="color:#b1aca0;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:13px;line-height:18px;text-decoration:none;padding-bottom:24px"><span style="color:#b1aca0;text-decoration:none;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;font-size:13px;line-height:18px">{office_address} </span></p>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>'