(10, 'tr_export', 'Download TR ZIP File', 'Export Request Confirmed - {site}', '<div style="margin:0;padding:0;width:100%;font-weight:500;font-size:16px;line-height:26px;background:none #fafafa;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\r\n<table align="center" border="0" cellpadding="20" cellspacing="0" style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:100%;margin:0;padding:0;line-height:100%;background:none #fafafa">\r\n	<tbody>\r\n		<tr style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\r\n			<td style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;width:100%">\r\n			<table align="center" border="0" cellpadding="0" cellspacing="0" style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:650px">\r\n				<tbody>\r\n					<tr style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\r\n						<td style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;width:100%">\r\n						<table style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:100%">\r\n							<tbody>\r\n								<tr style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\r\n									<td align="left" height="45" style="width:50%;color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;padding:0 0 15px"><a style="color:#11B5C4;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none" target="_blank"> <img alt="{site}" src="{site_link}images/new-logo.png" style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;outline:none;text-decoration:none;max-width:100%;border:none" width="100" /> </a></td>\r\n									<td align="right" style="width:50%;color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;padding:0 0 15px">&nbsp;</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n\r\n						<table align="left" cellpadding="25" style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:100%;background:none #fff;border-radius:2px;border:solid 1px #eee">\r\n							<tbody>\r\n								<tr style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\r\n									<td style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;width:100%;vertical-align:top">\r\n									<h1 style="color:#11B5C4;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;font-weight:300;line-height:1.1;margin:0 0 20px">Hi {name},</h1>\r\n\r\n									<p style="color:#464643;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:16px;line-height:160%;font-weight:400;padding:0 0 32px;padding-bottom:0px">Thank you for joining us, we are really excited to share services we offer on <a style="color:#11B5C4;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none" target="_blank"> {site}</a>.</p>\r\n									&nbsp;\r\n\r\n									<p style="text-align:center;color:#464643;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:16px;line-height:160%;font-weight:400;padding:0 0 32px;padding-bottom:0px">Please find below metioned username,email for your account</p>\r\n									&nbsp;\r\n\r\n									<p style="text-align:center;color:#464643;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:16px;line-height:160%;font-weight:400;padding:0 0 32px;padding-bottom:0px">User Name : {name}</p>\r\n									&nbsp;\r\n\r\n									<p style="text-align:center;color:#464643;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:16px;line-height:160%;font-weight:400;padding:0 0 32px;padding-bottom:0px">Email : {email}</p>\r\n									{zipUrl} &nbsp;\r\n\r\n									<p style="color:#464643;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:16px;line-height:160%;font-weight:400;padding:0 0 32px;padding-bottom:0px">Cheers,<br />\r\n									Team {site}</p>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n\r\n						<table style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:100%;padding:24px 0">\r\n							<tbody>\r\n								<tr style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\r\n									<td align="center" height="150" style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;width:100%">\r\n									<p style="color:#b1aca0;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:13px;line-height:18px;text-decoration:none;padding-bottom:24px"><a style="color:#8f8776;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none;font-size:13px;line-height:18px" target="_blank"> <img alt="{site}" src="{site_link}images/small-logo.png" style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;outline:none;text-decoration:none;max-width:100%;border:none" width="32" /> </a></p>\r\n\r\n									<p style="color:#b1aca0;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:13px;line-height:18px;text-decoration:none;padding-bottom:24px">This email was sent to <a href="mailto:{email}" style="color:#8f8776;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none;font-size:13px;line-height:18px" target="_blank"> {email}</a>.<br />\r\n									If you want to unsubscribe the emails from {site}, please drop a email at <a href="mailto:{help_email}" style="color:#8f8776;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none;font-size:13px;line-height:18px" target="_blank"> {help_email}</a>.<br />\r\n									If you have any questions or concerns, please email us at <a href="mailto:{info_email}" style="color:#8f8776;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none;font-size:13px;line-height:18px" target="_blank"> {info_email}</a>.</p>\r\n\r\n									<p style="color:#b1aca0;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:13px;line-height:18px;text-decoration:none;padding-bottom:24px"><span style="color:#b1aca0;text-decoration:none;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;font-size:13px;line-height:18px">{office_address} </span></p>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>', '{name},{email},{site},{help_email},{info_email},{site_link},{office_address},{zipUrl}', 'active', '2018-02-16 06:22:20'),
(11, 'tr_login_password', 'Admin | TR Login ', 'TR Login Details - {site}', '<div style="margin:0;padding:0;width:100%;font-weight:500;font-size:16px;line-height:26px;background:none #fafafa;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\r\n<table align="center" border="0" cellpadding="20" cellspacing="0" style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:100%;margin:0;padding:0;line-height:100%;background:none #fafafa">\r\n	<tbody>\r\n		<tr style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\r\n			<td style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;width:100%">\r\n			<table align="center" border="0" cellpadding="0" cellspacing="0" style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:650px">\r\n				<tbody>\r\n					<tr style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\r\n						<td style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;width:100%">\r\n						<table style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:100%">\r\n							<tbody>\r\n								<tr style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\r\n									<td align="left" height="45" style="width:50%;color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;padding:0 0 15px"><a style="color:#11B5C4;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none" target="_blank"> <img alt="{site}" src="{site_link}images/new-logo.png" style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;outline:none;text-decoration:none;max-width:100%;border:none" width="100" /> </a></td>\r\n									<td align="right" style="width:50%;color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;padding:0 0 15px">&nbsp;</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n\r\n						<table align="left" cellpadding="25" style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:100%;background:none #fff;border-radius:2px;border:solid 1px #eee">\r\n							<tbody>\r\n								<tr style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\r\n									<td style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;width:100%;vertical-align:top">\r\n									<h1 style="color:#11B5C4;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;font-weight:300;line-height:1.1;margin:0 0 20px">Hi {name},</h1>\r\n\r\n									<p style="color:#464643;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:16px;line-height:160%;font-weight:400;padding:0 0 32px;padding-bottom:0px">Your TR Login Credentials are as below.</p>\r\n									&nbsp;\r\n\r\n									<p style="text-align:center;color:#464643;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:16px;line-height:160%;font-weight:400;padding:0 0 32px;padding-bottom:0px">TR ID : {tr_id}</p>\r\n\r\n									<p style="text-align:center;color:#464643;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:16px;line-height:160%;font-weight:400;padding:0 0 32px;padding-bottom:0px">Password : {password}</p>\r\n									&nbsp;\r\n\r\n									<p style="color:#464643;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:16px;line-height:160%;font-weight:400;padding:0 0 32px;padding-bottom:0px"><br />\r\n									Cheers,<br />\r\n									Team {site}</p>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n\r\n						<table style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;width:100%;padding:24px 0">\r\n							<tbody>\r\n								<tr style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif">\r\n									<td align="center" height="150" style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;border-collapse:collapse;width:100%">\r\n									<p style="color:#b1aca0;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:13px;line-height:18px;text-decoration:none;padding-bottom:24px"><a style="color:#8f8776;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none;font-size:13px;line-height:18px" target="_blank"> <img alt="{site}" src="{site_link}images/small-logo.png" style="color:#FF5B5F;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;outline:none;text-decoration:none;max-width:100%;border:none" width="32" /> </a></p>\r\n\r\n									<p style="color:#b1aca0;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:13px;line-height:18px;text-decoration:none;padding-bottom:24px">This email was sent to <a href="mailto:{email}" style="color:#8f8776;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none;font-size:13px;line-height:18px" target="_blank"> {email}</a>.<br />\r\n									If you want to unsubscribe the emails from {site}, please drop a email at <a href="mailto:{help_email}" style="color:#8f8776;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none;font-size:13px;line-height:18px" target="_blank"> {help_email}</a>.<br />\r\n									If you have any questions or concerns, please email us at <a href="mailto:{info_email}" style="color:#8f8776;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;text-decoration:none;font-size:13px;line-height:18px" target="_blank"> {info_email}</a>.</p>\r\n\r\n									<p style="color:#b1aca0;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;margin:0;font-size:13px;line-height:18px;text-decoration:none;padding-bottom:24px"><span style="color:#b1aca0;text-decoration:none;font-family:Helvetica Neue,Helvetica,Arial,sans-serif;font-size:13px;line-height:18px">{office_address} </span></p>\r\n									</td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>', '{name},{email},{site},{help_email},{info_email},{site_link},{office_address},{password},{email},{tr_id}', 'active', '2018-02-16 06:22:44');
INSERT INTO `faq` (`id`, `faq_question`, `faq_answer`, `status`, `created_at`, `updated_at`) VALUES
(5, 'How do i know the TR Password ?', 'you will receive an email contain the TR number and the password for it, but before that you need to get approved from your supervisor', 'active', '2017-12-08 03:54:20', '2018-04-06 01:19:09'),
(7, 'What is Secure TR ?', 'Secure TR is a modular based system that only selected users will be approved, this feature is for send and receive a secret Telegram or confidential data that can be automatically destroyed within certain period of time set by sender.', 'active', '2018-01-19 21:34:18', '2018-04-06 01:18:11'),
(8, 'How to report an issue with this app ?', 'you can freely drop an email to cerian@westixx.com or you can reach us through "contact us" feature, we will catch up in email', 'active', '2018-01-22 20:00:57', '2018-04-06 01:16:48'),
(9, 'What is MDS ?', 'MDS is stand for Mobile Digital Secure, bringing app that server as a mobile application for limited users and most concerned about security and organization privacy. it comes with high level encryption method to all users', 'active', '2018-02-12 02:36:14', '2018-04-06 01:15:39');
