(1, 'About Us', 'about', '2018-08-15 07:05:08', '2018-08-15 07:05:08', '<p style="margin-bottom: 0in; line-height: 100%;"><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">The&nbsp;Indonesian National Police&nbsp;(</font></font></font><a href="https://en.wikipedia.org/wiki/Indonesian_language"><font color="#0782c1"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">Indonesian</font></font></font></a><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">:&nbsp;Kepolisian Negara Republik Indonesia,&nbsp;&quot;POLRI&quot;) is the national&nbsp;</font></font></font><a href="https://en.wikipedia.org/wiki/Police"><font color="#0782c1"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">police</font></font></font></a><font color="#333333">&nbsp;</font><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">force of&nbsp;</font></font></font><a href="https://en.wikipedia.org/wiki/Indonesia"><font color="#0782c1"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">Indonesia</font></font></font></a><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">. It was formerly a part of the&nbsp;</font></font></font><a href="https://en.wikipedia.org/wiki/Indonesian_National_Armed_Forces"><font color="#0782c1"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">Indonesian National Armed Forces</font></font></font></a><font color="#333333">&nbsp;</font><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">(&quot;ABRI&quot;). The police were formally separated from the&nbsp;</font></font></font><a href="https://en.wikipedia.org/wiki/Indonesian_National_Armed_Forces"><font color="#0782c1"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">military</font></font></font></a><font color="#333333">&nbsp;</font><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">(&quot;TNI&quot;) in April 1999, The organization is now independent and is under the direct auspices of the President of Indonesia, while the Armed Forces is under the&nbsp;</font></font></font><a href="https://en.wikipedia.org/wiki/Ministry_of_Defence_(Indonesia)"><font color="#0782c1"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">Ministry of Defense</font></font></font></a><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">. Until this day, the Indonesian National Police is and still holds control of law enforcement and policing duties all over Indonesia nationally.</font></font></font><br />\r\n&nbsp;</p>\r\n\r\n<div style="margin-bottom: 0in; line-height: 100%;"><strong><font color="#2883dd"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 12pt">Vision</font></font></font></strong></div>\r\n\r\n<div style="margin-bottom: 0in; line-height: 100%;">&nbsp;</div>\r\n\r\n<ul>\r\n	<li style="margin-bottom: 0in; line-height: 100%;"><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">The realization of the security services and public order are primed,</font></font></font></li>\r\n	<li style="margin-bottom: 0in; line-height: 100%;"><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">The rule of law and security in the nation stable and synergy policioned and proactive</font></font></font></li>\r\n</ul>\r\n\r\n<p style="margin-bottom: 0in; line-height: 100%;"><br />\r\n&nbsp;</p>\r\n\r\n<p style="margin-bottom: 0in; line-height: 100%;"><strong><font color="#2883dd"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 12pt">Mission</font></font></font></strong></p>\r\n\r\n<ol>\r\n	<li style="margin-bottom: 0in; line-height: 100%;"><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">Early detection and attention through activities/operation investigation, security and safety</font></font></font></li>\r\n	<li style="margin-bottom: 0in; line-height: 100%;"><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">Providing safety, protection and service easier, responsive with non-discriminatory</font></font></font></li>\r\n	<li style="margin-bottom: 0in; line-height: 100%;"><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">Preserve security, discipline and the traffic continuity for ensuring safety and continuity both human and materials</font></font></font></li>\r\n	<li style="margin-bottom: 0in; line-height: 100%;"><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">Ensuring the key success countermeasures of disruption of internal security</font></font></font></li>\r\n	<li style="margin-bottom: 0in; line-height: 100%;"><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">Enhance the national police society based on a law-abiding community</font></font></font></li>\r\n	<li style="margin-bottom: 0in; line-height: 100%;"><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">Enforce the law in a professional, objective, proportionate, transparent and accountable way to ensure legal certainty and a sense of justice</font></font></font></li>\r\n	<li style="margin-bottom: 0in; line-height: 100%;"><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">Managing with professional, transparent, accountable and modern entire police resources to support operational police duties</font></font></font></li>\r\n	<li style="margin-bottom: 0in; line-height: 100%;"><font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt">Building a interdepartmental synergy of police and international organization as well as the society in order to build partnership and network</font></font></font></li>\r\n</ol>\r\n\r\n<p style="margin-bottom: 0in; line-height: 100%;"><br />\r\n<font color="#333333"><font face="sans-serif, Arial, Verdana, Trebuchet MS"><font style="font-size: 9pt"><strong>Thank You !</strong></font></font></font></p>', '5ac7550442f74_mds_static_content.jpeg', 1, 'admin'),
