(11, 'About Us', 'about', '2018-04-08 17:43:21', '2018-04-08 17:43:21', '<p>This term and condition apply to all division, sub division, affiliate and organization below Polri that use Mobile Digital Secure, and all devices that installing Mobile Digital Secure&nbsp;and not limited to the owner of the device, both Polri&rsquo;s asset as well as out of Polri&rsquo;s control (such as: personal owned devices, business partner devices, visitor devices, and etc).<br />\r\n<br />\r\nUsers should use Mobile Digital Secure&nbsp;and fully responsible with their account and all activity below the Indonesia&rsquo;s law.<br />\r\n<br />\r\nUsers prohibited to use the activity as mentioned below:</p>\r\n\r\n<ol>\r\n	<li>Send spam, malware, virus and other malicious data</li>\r\n	<li>Using system for sending or receiving files that detected outrage the law (such as: gambling, pornography, etc</li>\r\n	<li>Using system for activity that contains intimidation, threats, or other activity that may interfere with other private parties or groups</li>\r\n	<li>Sharing user name or account</li>\r\n</ol>\r\n\r\n<p>Users who have detected either do the unresponsible activity or beyond those point, their access will be revoked and they shall report to Administrator to gain new access</p>\r\n\r\n<p>Users that experiencing issue caused by these point</p>\r\n\r\n<ol>\r\n	<li>Unable to connect into Mobile Digital Secure for the first time receive invitation</li>\r\n	<li>Unable to login due to already logged on at another device or due to device lost/broken</li>\r\n	<li>Found errors, bugs and unproper apps function</li>\r\n</ol>\r\n\r\n<p>Users that experiencing any of those point above or having other issues, shall report to MDS support&nbsp;by email to cerian@westixx.com<br />\r\n<br />\r\n<br />\r\nThank You,<br />\r\nRegards,<br />\r\nNational Police of Indonesia</p>', '5acac36e2425f_mds_static_content.png', 5, 'branch-admin'),
